require 'rails_helper'

describe PostsController do
  # TODO 
  # 1. Mock S3 request here in spec
  # 2. Use database cleaner for transaction clean up
  # 3. Transfer those base64 data on a helper.

  describe '#create' do
    context 'when valid params' do
      before do
        post :create, format: :json, params: {
          post: {
            title: 'TenderLove',
            content: 'I love my cats',
            image_base64: image_base64
          }
        }
      end

      it 'successfully created' do
        expect( response ).to have_http_status( 201 )
        expect( JSON( response.body )['title'] ).not_to be nil 
        expect( JSON( response.body )['content'] ).not_to be nil
      end
    end

    context 'when invalid params' do
      context 'when title is nil/empty' do
        before do 
          post :create, format: :json, params: {
            post: {
              title: nil,
              content: 'I love my cats',
              image_base64: image_base64
            }
          }
        end

        it 'return http status 422' do
          expect( response ).to have_http_status( 422 )
        end

        it 'returns error message on empty title' do
          expect( JSON( response.body ) ).to eq( "title" => ["can't be blank"] )
        end
      end

      context 'when content is nil/empty' do
        before do 
          post :create, format: :json, params: {
            post: {
              title: 'TenderLove',
              content: nil,
              image_base64: image_base64
            }
          }
        end

        it 'return http status 422' do
          expect( response ).to have_http_status( 422 )
        end

        it 'returns error message on content' do
          expect( JSON( response.body )).to eq( "content" => ["can't be blank"] )
        end
      end

      context 'when image_base64 is nil/empty' do
        before do 
          post :create, format: :json, params: {
            post: {
              title: 'TenderLove',
              content: 'I love my cats',
              image_base64: ''
            }
          }
        end

        it 'return http status 422' do
          expect( response ).to have_http_status( 422 )
        end

        it 'returns error message on empty title' do
          expect( JSON( response.body ) ).to eq( "image_base64" => ["can't be blank"] )
        end
      end
    end

    describe '#update' do
      let(:post) { create(:post) }

      context 'when valid params' do
        context 'when title and content updated' do
          before do
            put :update, format: :json, params: {
              id: post.id,
              post: {
                title: 'NotSoTenderLove',
                content: 'I hate cats'
              }
            }
          end
    
          it 'title and content successfully updated' do
            expect( response ).to have_http_status( 200 )
            expect( JSON( response.body )['title'] ).to eq( 'NotSoTenderLove' ) 
            expect( JSON( response.body )['content'] ).to eq( 'I hate cats' )
          end
        end

        context 'when png format of base64' do
          before do
            put :update, format: :json, params: {
              id: post.id,
              post: {
                image_base64: image_png_base64,
                image_id: post.images.first.id
              }
            }
          end

          it { expect( response ).to have_http_status( 200 ) }
        end
      end

      context 'when invalid params' do
        context 'when title and content are nil/empty', focus: true do
          before do
            put :update, format: :json, params: {
              id: post.id,
              post: {
                title: nil,
                content: nil
              }
            }
          end
    
          it 'return http status 422' do
            expect( response ).to have_http_status( 422 )
          end

          it 'return error message on title and content' do
            expect( JSON( response.body ) ).to include( "title" => ["can't be blank"] )
            expect( JSON( response.body ) ).to include( "content" => ["can't be blank"] )
          end
        end

        context 'when invalid image format of base64' do
          before do
            put :update, format: :json, params: {
              id: post.id,
              post: {
                image_base64: gif_base64,
                image_id: post.images.first.id
              }
            }
          end

          it 'return http status 422' do
            expect( response ).to have_http_status( 422 )
          end

          it "returns error message on image format" do
            expect( JSON( response.body ) ).to include( "image_content_type"=>["is invalid"] )
          end
        end

        context 'when image id is not exist' do
          let( :non_existent_id ) { 101010101 }

          before do
            put :update, format: :json, params: {
              id: post.id,
              post: {
                image_base64: image_png_base64,
                image_id: non_existent_id
              }
            }
          end

          it 'return http status 404' do
            expect( response ).to have_http_status( 404 )
          end

          it "returns error message on id not found" do
            expect( JSON( response.body )['error'] ).to eq( "Couldn't find any record." )
          end
        end
      end
    end
  end

  private

  def image_base64
    "data:image/jpeg;base64,"
  end

  def image_png_base64
    "data:image/png;base64,"
  end

  def gif_base64
    "data:image/gif;base64,"
  end
end